  console.log(mainArrayItemState);

  //adding the useeffect  hook so that i avoid the rerender on state change for my array
  useEffect(()=>{
    async function getdetails()
    {
              const getResponse=await fetch("completeDetails/get",{
                headers : { 
                    'Content-Type': 'application/json',
                    'Accept': 'application/json'
                   },
            
                method:"GET",
              
    
              }
              ).then(response=>response.json())
              .then(data=>changeMainArrayItemState([...data]));
            }
            getdetails();
          },[]);
      
      //its a object

    //using an array to convert the object into array since i wanna use a map
    let alpha=Object.entries(mainArrayItemState);
    console.log(typeof alpha);   
    console.log(alpha);

    return (

      
        <div>
        <div class="card"  style={{ width: '18rem' }} >
        <img src="..." class="card-img-top" alt="..."/>
        <div class="card-body">
          <h5 class="card-title">Card title</h5>
          <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
          <a href="#" class="btn btn-primary">Go somewhere</a>
        </div>
      </div>
        </div>
              
    )
}
